import React, { useState } from 'react';
import { registerUser } from '../services/UserService';
import { Link, useNavigate } from 'react-router-dom';

function Register() {
  const [form, setForm] = useState({
    name: '',
    email: '',
    password: '',
    contactNumber: '',
    role: '',
    shippingAddress: '',
    paymentDetails: ''
  });

  const navigate = useNavigate();

  const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      await registerUser(form);
      alert('Registered successfully!');
      navigate('/login');
    } catch (err) {
      console.error('Registration error:', err.response?.data || err.message);
      alert('Registration failed: ' + (err.response?.data?.message || err.message));
    }
  };

  const containerStyle = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    background: 'linear-gradient(135deg, #7b68ee 0%, #6a5acd 100%)', // fresh purple-blue gradient
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    padding: '0 10px',
  };

  const boxStyle = {
    backgroundColor: 'white',
    padding: '28px 22px',
    borderRadius: '12px',
    boxShadow: '0 10px 25px rgba(0, 0, 0, 0.18)',
    width: '100%',
    maxWidth: '340px',
    textAlign: 'center',
  };

  const inputStyle = {
    width: '100%',
    padding: '10px 12px',
    margin: '7px 0',
    borderRadius: '8px',
    border: '1.5px solid #ccc',
    fontSize: '15px',
    transition: 'border-color 0.3s',
  };

  const buttonStyle = {
    width: '100%',
    padding: '12px',
    marginTop: '14px',
    backgroundColor: '#6a5acd', // deeper purple button
    border: 'none',
    borderRadius: '10px',
    color: 'white',
    fontSize: '16px',
    fontWeight: '600',
    cursor: 'pointer',
    boxShadow: '0 5px 15px rgba(106, 90, 205, 0.6)',
    transition: 'background-color 0.3s',
  };

  const buttonHoverStyle = {
    backgroundColor: '#574fcf',
  };

  const linkStyle = {
    color: '#6a5acd',
    textDecoration: 'none',
    fontWeight: '500',
    fontSize: '14px',
  };

  // Optional: Add hover effect on button
  const [isHover, setIsHover] = React.useState(false);

  return (
    <div style={containerStyle}>
      <div style={boxStyle}>
        <h2 style={{ marginBottom: '14px', fontSize: '22px', color: '#4a4a4a' }}>Register</h2>
        <form onSubmit={handleRegister}>
          <input name="name" value={form.name} onChange={handleChange} placeholder="Name" required style={inputStyle} />
          <input name="email" value={form.email} onChange={handleChange} placeholder="Email" required style={inputStyle} />
          <input name="password" type="password" value={form.password} onChange={handleChange} placeholder="Password" required style={inputStyle} />
          <input name="contactNumber" value={form.contactNumber} onChange={handleChange} placeholder="Contact Number" style={inputStyle} />
          <input name="role" value={form.role} onChange={handleChange} placeholder="Role" style={inputStyle} />
          <input name="shippingAddress" value={form.shippingAddress} onChange={handleChange} placeholder="Shipping Address" required style={inputStyle} />
          <input name="paymentDetails" value={form.paymentDetails} onChange={handleChange} placeholder="Payment Details" required style={inputStyle} />
          <button
            type="submit"
            style={isHover ? { ...buttonStyle, ...buttonHoverStyle } : buttonStyle}
            onMouseEnter={() => setIsHover(true)}
            onMouseLeave={() => setIsHover(false)}
          >
            Register
          </button>
        </form>
        <p style={{ marginTop: '14px', fontSize: '14px', color: '#444' }}>
          Already have an account? <Link to="/login" style={linkStyle}>Login here</Link>
        </p>
      </div>
    </div>
  );
}

export default Register;
